<script>
	import home from '@/components/home';
	import {
		getUserInfo,
		getlevelInfo,
		getlevelExpList
	} from '@/api/user.js';
	export default {
		components: {
			home
		},
		data() {
			return {
				userInfo: '',
				levelInfo: '',
				levelList: [],
				current: 0,
				widthLen: 0,
				loading: false,
				loadend: false,
				loadTitle: '加载更多', //提示语
				page: 1,
				limit: 20,
				expList: []
			};
		},
		onShow() {
			this.getUserInfo();
			this.getInfo();
			this.getlevelList();
		},
		methods: {
			/**
			 * 获取个人用户信息
			 */
			getUserInfo: function() {
				let that = this;
				getUserInfo().then(res => {
					that.userInfo = res.data
				}).catch(function(res) {
					return that.$util.Tips({
						title: res.msg
					});
				})
			},
			getInfo: function() {
				let that = this;
				getlevelInfo().then(res => {
					let levelInfo = res.data.level_info.exp;
					let levelList = res.data.level_list;
					let list = []
					that.levelInfo = levelInfo;
					that.levelList = levelList;
					levelList.forEach((item, index) => {
						if (item.exp_num <= levelInfo) {
							list.push(item.exp_num)
						}
					})
					let maxn = Math.max.apply(null, list);
					that.current = maxn;
					// 解决len取的值没有时；
					let levelListLen = levelList[list.length] ? levelList[list.length] : levelList[list.length - 1];
					// 解决除数不能为0
					let divisor = levelListLen.exp_num - maxn ? levelListLen.exp_num - maxn : 1;
					// 每小格所占的百分比
					let per = (levelInfo - maxn) / divisor / levelList.length;

					that.widthLen = ((list.length - 0.5) / (levelList.length)) * 100 + per * 100

				}).catch(function(res) {
					return that.$util.Tips({
						title: res.msg
					});
				})
			},
			getlevelList: function() {
				let that = this
				if (this.loadend) return false;
				if (this.loading) return false;
				getlevelExpList( {
					page: that.page,
					limit: that.limit
				}).then(res => {
					let list = res.data,
						loadend = list.length < that.limit;
					let expList = that.$util.SplitArray(list, that.expList);
					that.$set(that, 'expList', expList);
					that.loadend = loadend;
					that.loadTitle = loadend ? '我也是有底线的' : '加载更多';
					that.page = that.page + 1;
					that.loading = false;
				}).catch(err => {
					that.loading = false;
					that.loadTitle = '加载更多';
				});
			}
		},
		onReachBottom: function() {
			this.getlevelList();
		}
	}
</script>

